import React from "react";
import '../css/content.css';
import '../css/colors.css';


function Navbar() {
  return (
    <div class="main">
      <div className="content-action">
        <div>
          <a href="#prev"><i class="fa-regular fa-angle-left"></i></a>
          <a href="#prev"><i class="fa-regular fa-arrow-right"></i></a>
        </div>
        <input className="content-search" placeholder="Search"></input>
        <div className="content-notificatino">notification</div>
        <div className="user">
          <div className="user-avatar"></div>
          <div className="user">
            <span>User Name</span>
            <span>User level</span>
          </div>
        </div>
      </div>
    </div>

  );
}

export default Navbar;
